import { TaskDTO } from './dto/task.dto'

export class TaskAPI {
  public static async getAll(): Promise<TaskDTO[]> {
    const resp = await fetch('http://localhost:4000/tasks/', {
      method: 'GET',
    })

    return await resp.json()
  }
}
